import React from 'react';
import logo from './logo.svg';
import {Component} from 'react';
import './LandingPage.css';

export interface ILandingPageProps {

}

export interface ILandingPageState {
  activeTab: number
}

class LandingPage extends Component<ILandingPageProps, ILandingPageState> {
  constructor(props: ILandingPageProps) {
    super(props);
    this.setActiveTab = this.setActiveTab.bind(this);
    this.state = {
      activeTab: 1
    }
  }

  setActiveTab = (tab: number) => {
    console.log(tab);
    this.setState({
      activeTab: tab
    })
  }

  render() {
    return (
      <div className="landing-page-main-container">
      <div className="lp-top-row">
      <div className="float-left logo">
      <img src="../src/logo.png"></img>
      </div>
      <div className="float-right menu">
      <div className="btn-group" role="group" aria-label="Basic example">
        <button type="button" className="btn menu-tab-button" onClick={()=>this.setActiveTab(1)}>Left</button>
        <button type="button" className="btn menu-tab-button">Middle</button>
      </div>
      </div>
      </div>
      </div>
    );
  }
}

export default LandingPage;
